const Footer = () => {
    return(
        <footer className="row">
            <article className="col-12 col-sm-12 col-lg-12 col-xl-12">
                <ul>
                    <li>&copy;Copyright reserved MarketBlets.com 2020</li>
                    <li>Powered by <a href="https://nezzed.com">nezzed.com</a></li>
                </ul>
            </article>
        </footer>
    )
}

export default Footer;
